INSERT INTO `evaluaciondiag` (`id_paciente`, `tecnicas`, `observaciones`, `analisis`, `diagnostico`, `tratamiento`) VALUES
(17, '*Se describen las técnicas utilizadas*', '*Se describen las observaciones generales de la conducta*', '*Se describe el análisis de las técnicas y observaciones*', '*Se describe el diagnóstico final*', '*Se describe el tratamiento y el plan de orientación*'),
(18, '*Se describen las técnicas*', '*Se describen las observaciones*', '*Se describe el análisis e interpretación de resultados*', '*Se describe el diagnóstico*', '*Se describe el tratamiento*'),
(19, 'Observación\nEntrevista Psicológica\nPruebas Psicométricas:\nTest Guestáltico Visomotor Para Niños Bender\nTest Inteligencia de RAVEN.\nTest de la Madurez Mental CALIFORNIA\nTest Proyectivo de la Familia.', 'El menor que aparenta su edad cronológica de tez trigueña, cabellos lacios, ojos negros de contextura delgada, estatura normal a su edad, presenta descuido en su arreglo y aseo personal , postura encorvada, denotando una expresión facial de desconfianza frente al entrevistador, poco colaborador frente a preguntas de su comportamiento y referencia familiar, de lenguaje coherente, con variabilidad en la fluidez de rápida a callada utiliza un lenguaje coprolalico, posee rotacismo por lo cual tiene dificultad para pronunciar la letra “r”, mostrando poca predisposición durante la entrevista. El menor se encuentra orientado en tiempo espacio y persona su memoria se encuentra conservada, su percepción es adecuada, de pensamiento rígido con contenido hostil frente a las personas, animales, de afecto de ánimo alterado presentado arrebatos de cólera, impulsivo, violento con falta de espontaneidad de sus emociones mal empleo de su funcionamiento intelectual.', 'El menor presenta una capacidad intelectual dentro del promedio pero no hace uso de sus potencialidades, por lo que su rendimiento escolar no es adecuado. S es un niño inestable emocionalmente, predomina en un tipo de sistema nervioso fuerte desequilibrado por lo que manifiesta agresividad e impulsividad en su comportamiento, posee baja autoestima y baja tolerancia a la frustración, con falta de espontaneidad de sus emociones manifiesta sentimientos de inconformidad y resentimiento para con sus padres.\n\nSus relaciones interpersonales se han visto afectados a consecuencia de los problemas familiares, frecuentemente tiene problemas para obedecer reglas y ordenes de los adultos, hurta dinero para ir a jugar a las cabinas de Internet o comprarse golosinas, lastima a los animales con el fin de descargar su ira por haber sido castigado.\n\nEl menor proviene de un hogar disfuncional donde es golpeado con frecuencia por el padre manteniendo una mala relación con todos los miembros de la familia aunque sin embargo, da mayor valor a la madre y se muestra molesto e indiferente hacia el padre, la mayor parte del tiempo prefiere estar fuera de casa para no presenciar las peleas entre sus padres o para evitar hacerse cargo de sus hermanos menores.\n\nComo estudiante es despreocupado en sus deberes, interesado cuando desea obtener algún beneficio, no es conciente de que sus conductas le acarrean problemas.', 'El paciente no presenta signos de lesión y disfunción cerebral, tiene una capacidad intelectual dentro del promedio, es un niño inestable emocionalmente, con un tipo de sistema nervioso fuerte – desequilibrado, por ello es impulsivo, agresivo violento, posee baja autoestima es inseguro y hermético frente a su comportamiento, no mantiene buenas relaciones interpersonales, es despreocupado en sus deberes de la escuela.\n\nEl menor presenta una relación conflictiva con la figura paterna, frecuentemente se opone a las reglas de la escuela, es desafiante con los adultos en especial con los padres.\n\nDesde su concepción el menor se ha desarrollado en ambiente familiar disfuncional, con presencia de violencia entre los padres, carencia afectiva paterna y una inadecuada formación correctiva.\n\nConsiderando el criterio diagnostico del DSM IV, concluimos que el menor presenta un comportamiento antisocial en la niñez.', '*        Psicoterapia individual\n\n–           Terapia de relajación\n\n–           Modificación de la conducta\n\n–           Terapia lúdica\n\n–           Incrementar  hábitos   de  estudio,  mediante  un  programa para optimizar el rendimiento académico.\n\n*          Psicoterapia familiar\n\n*          Psicoterapia de apoyo');

